import React from "react";
import LibrarySongs from "./LibrarySongs";

const Library = ({ songs }) => {
  return (
    <div className="library-cover">
      <h2>.Library</h2>
      {songs.map((song) => {
        return <LibrarySongs song={song} />;
      })}
    </div>
  );
};

export default Library;
